import { LiaToolsSolid } from "react-icons/lia";
import getStyling from "./style";
import { FC } from "react";
import { IMappedIconProps } from "./interface";
import {
  IoBuildOutline,
  IoConstructOutline,
  IoSettingsOutline,
  IoHammerOutline,
  IoReaderOutline,
  IoAddCircleOutline,
  IoAdd,
  IoAlertCircleOutline,
} from "react-icons/io5";

const MappedIcon: FC<IMappedIconProps> = (props) => {
  const { iconName, taskIconStyleOverride } = props;
  const styles = getStyling();

  if (iconName === "build-outline")
    return (
      <IoBuildOutline
        size={30}
        style={{ ...styles.rowIcon, ...taskIconStyleOverride }}
      />
    );

  if (iconName === "construct-outline")
    return (
      <IoConstructOutline
        size={30}
        style={{ ...styles.rowIcon, ...taskIconStyleOverride }}
      />
    );

  if (iconName === "settings-outline")
    return (
      <IoSettingsOutline
        size={30}
        style={{ ...styles.rowIcon, ...taskIconStyleOverride }}
      />
    );

  if (iconName === "hammer-outline")
    return (
      <IoHammerOutline
        size={30}
        style={{ ...styles.rowIcon, ...taskIconStyleOverride }}
      />
    );

  if (iconName === "reader-outline")
    return (
      <IoReaderOutline
        size={30}
        style={{ ...styles.rowIcon, ...taskIconStyleOverride }}
      />
    );

  if (iconName === "add-circle-outline")
    return (
      <IoAddCircleOutline
        size={30}
        style={{ ...styles.rowIcon, ...taskIconStyleOverride }}
      />
    );

  if (iconName === "add-outline")
    return (
      <IoAdd
        size={30}
        style={{ ...styles.rowIcon, ...taskIconStyleOverride }}
      />
    );

  if (iconName === "alert-circle-outline")
    return (
      <IoAlertCircleOutline
        size={30}
        style={{ ...styles.rowIcon, ...taskIconStyleOverride }}
      />
    );

  /// ****
  return (
    <LiaToolsSolid
      size={30}
      style={{ ...styles.rowIcon, ...taskIconStyleOverride }}
    />
  );
};

export default MappedIcon;
